import React, { Component } from "react";
import {DetailWrapper, Header, Content} from "./style"

class Detail extends Component {
  render() {
    return (
      <DetailWrapper>
        <Header>遇鹿呈祥</Header>
        <Content>
          <img src = ""></img>
        </Content>
      </DetailWrapper>
    );
  }
}

export default Detail;
